		"text": "성취하고 \n성공하고 싶은 마음,\n사랑받고 \n사랑하고 싶은 마음,\n표현하고 인정받고 \n이해받고 싶은 마음, \n반려를 찾고 싶은 마음이나 아이를 가지고 싶은 마음도\n결국 모두 내 존재의 의미를 찾기 위해 생겨나는 것들입니다."
